    // You can change the inputs, or the scope of your function, as needed.
    function swapTokensForETH(uint amountTokens, uint amountETHMin)
        external 
        payable
    {
        uint _reserveToken = token_reserves; /// save gas
        uint _reserveEth = eth_reserves; /// save gas

        require(amountTokens > 0 && amountTokens < _reserveToken, "Invalid Amount In");
        require(token_reserves > 0 && eth_reserves > 0, "Insufficient reserves");

        uint _feeAmountToken = amountTokens * swap_fee_numerator / swap_fee_denominator;
        uint _exactAmountToken = amountTokens - _feeAmountToken;

        uint amount_out_numerator = _exactAmountToken * _reserveEth;
        uint amount_out_denominator = _reserveToken + _exactAmountToken;
        uint _exactAmountEth = amount_out_numerator / amount_out_denominator;

        require(_exactAmountEth >= amountETHMin && _exactAmountEth < _reserveEth, "Insufficient ETH");
        token_reserves = _reserveToken + _exactAmountToken;
        eth_reserves = _reserveEth - _exactAmountEth;
        k = token_reserves * eth_reserves;
        token_fee_reserves += _feeAmountToken;

        token.transferFrom(msg.sender, address(this), amountTokens);
        payable(msg.sender).transfer(_exactAmountEth);
    }



