    function swapETHForTokens(uint amountTokenMin)
        external
        payable 
    {
        uint _reserveToken = token_reserves;
        uint _reserveEth = eth_reserves;

        uint amountEth = msg.value;
        require(amountEth > 0 && amountEth < _reserveEth, "Invalid Amount In");
        require(token_reserves > 0 && eth_reserves > 0, "Insufficient reserves");

        uint _feeAmountEth = amountEth * swap_fee_numerator / swap_fee_denominator;
        uint _exactAmountEth = amountEth - _feeAmountEth;

        uint amount_out_numerator = _exactAmountEth * _reserveToken;
        uint amount_out_denominator = _exactAmountEth + _reserveEth;
        uint _exactAmountToken = amount_out_numerator / amount_out_denominator;

        require(_exactAmountToken >= amountTokenMin && _exactAmountToken < _reserveToken, "Insufficient Token");

        eth_reserves = _reserveEth + _exactAmountEth;
        token_reserves = _reserveToken - _exactAmountToken;
        k = token_reserves * eth_reserves;
        eth_fee_reserves += _feeAmountEth;

        token.transferFrom(address(this), msg.sender, _exactAmountToken);
    }
